import React from 'react';
import SignIn from '../components/SignIn';
import SignUp from '../components/SignUp';

const SignInSignUp = () => {
    return (
        <div className="sign-in-sign-up">
            <SignIn />
            <SignUp />
        </div>
    );
}

export default SignInSignUp;
